import React, { Component } from 'react';
import { Card, Button, CardTitle,CardGroup, CardText,ListGroup } from 'reactstrap';
import { Link } from 'react-router-dom'
class Cart extends Component{
render(){
    return (
        
        //  <Card>
        //    <Card body>This is some text within a card body.</Card>
        //    <Card body>This is some text within a card body.</Card>
        // </Card>
        <Card style={{ width: '18rem' }}>
            <Card body>
                <Card Title value= "Card Title"/>
                <Card Subtitle className="mb-2 text-muted">Card Subtitle</Card>
                <Card text>
                Some quick example text to build on the card title and make up the bulk of
                the card's content.
                </Card>
                <Card Link href="#">Card Link</Card>
                <Card Link href="#">Another Link</Card>
            </Card>
        </Card>
        
        
      );
}
  
}

export default Cart;
